DROP TABLE IF EXISTS `mae_empresas`;
CREATE TABLE `mae_empresas` (
`empr_nit`  varchar(12) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`empr_nombre`  varchar(30) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT '' ,
`empr_nombrelargo`  varchar(254) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`empr_basedatos`  varchar(30) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT '' ,
`empr_tipoempresa`  enum('C','L') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'C' COMMENT 'C Cooperativa, L Limitada' ,
`empr_inventario`  enum('S','N') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'N' COMMENT 'Marca si la empresa maneja inventario' ,
`empr_finiciocontable`  date NOT NULL ,
`empr_logo`  varchar(30) CHARACTER SET latin1 COLLATE latin1_spanish_ci NULL DEFAULT NULL ,
PRIMARY KEY (`empr_nit`),
FOREIGN KEY (`empr_nit`) REFERENCES `mae_personas` (`pers_nit`) ON DELETE RESTRICT ON UPDATE CASCADE
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=latin1 COLLATE=latin1_spanish_ci

;

