-- ----------------------------
-- Table structure for mae_pagadurias
-- ----------------------------
DROP TABLE IF EXISTS `mae_pagadurias`;
CREATE TABLE `mae_pagadurias` (
`paga_nit`  varchar(12) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`paga_comision`  double(7,5) UNSIGNED NOT NULL DEFAULT 0.00000 ,
`paga_division`  enum('V','F') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'F' ,
`paga_pxrautomatico`  enum('S','N') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'N' COMMENT 'Los pagos por relacion toman un listado capturado automaticamente' ,
`paga_credirecto`  enum('S','N') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'N' COMMENT 'define si la empresa pertenece a un credito directo o no' ,
`paga_gestioninconsis`  enum('S','N') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'N' COMMENT 'Si la pagaduria permite gestión autom. de inconsis.' ,
`paga_estado`  enum('A','I') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'A' ,
`paga_usrcreacion`  varchar(30) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`paga_fcreacion`  timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ,
PRIMARY KEY (`paga_nit`),
FOREIGN KEY (`paga_nit`) REFERENCES `mae_personas` (`pers_nit`) ON DELETE RESTRICT ON UPDATE CASCADE,
FOREIGN KEY (`paga_usrcreacion`) REFERENCES `mae_usuarios` (`usua_alias`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `paga_usrcreacion` (`paga_usrcreacion`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=latin1 COLLATE=latin1_spanish_ci

;

