-- Records of mae_pagadurias
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for mae_pagaduriasdetalle
-- ----------------------------
DROP TABLE IF EXISTS `mae_pagaduriasdetalle`;
CREATE TABLE `mae_pagaduriasdetalle` (
`detp_nitsociedad`  varchar(12) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`detp_nitpagaduria`  varchar(12) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`detp_codnovedad`  varchar(12) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`detp_nombre`  varchar(100) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL ,
`detp_diaspreviosnovedad`  int(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Dias previos para el envio de novedad antes de la finicio descto.' ,
`detp_diasprevioscierre`  int(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Dias previos a la fecha máx. de novedad para el cierre de vtas.' ,
`detp_meseslibconvenio`  int(2) UNSIGNED NOT NULL DEFAULT 3 COMMENT 'Num. de meses para escoger en finicio al configurar lib. convenio' ,
`detp_mesesexigible`  int(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'No. de meses que una lib. es exigible respecto a su finicio.' ,
`detp_manejacargoxservicio`  enum('S','N') CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'N' COMMENT 'Guarda si maneja cargos por serv. en los creditos' ,
PRIMARY KEY (`detp_nitsociedad`, `detp_nitpagaduria`, `detp_codnovedad`),
FOREIGN KEY (`detp_nitsociedad`) REFERENCES `mae_personas` (`pers_nit`) ON DELETE RESTRICT ON UPDATE CASCADE,
FOREIGN KEY (`detp_nitpagaduria`) REFERENCES `mae_pagadurias` (`paga_nit`) ON DELETE RESTRICT ON UPDATE CASCADE,
UNIQUE INDEX `codnov` (`detp_codnovedad`) USING BTREE ,
INDEX `dete_nitsociedad` (`detp_nitsociedad`) USING BTREE ,
INDEX `dete_nitempresa` (`detp_nitpagaduria`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=latin1 COLLATE=latin1_spanish_ci

;

